icon = ""


def setIcon():
    global icon
    icon = b''


def getIcon():
    return icon


def saveIcon(path):
    with open(path, "wb+") as file:
        from base64 import b64decode
        file.write(b64decode(icon))


def getIconPath():
    from tempfile import mkstemp
    _, temp = mkstemp()
    setIcon()
    saveIcon(temp)
    return temp
